    //计算后的数据缓存区
    private double illuminance_sum;
    private double xSum;
    private double ySum;
    private double zSum;
    private double XY_x;
    private double XY_y;
    private double UV_u;
    private double UV_v;
    private double Duv;
    private int Pwave;
    private int Dwave;
    private double[] R_i;



    //构造时的传感器数据
    private double[] sensorData;

    public spactrumToParameterUtil(double[] sensorData) {
        this.sensorData = sensorData;
    }

    public void initPrameters() {
        this.illuminance_sum = sumByParameterArray(illuminance,this.sensorData);
        this.xSum = sumByParameterArray(X,this.sensorData);
        this.ySum = sumByParameterArray(Y,this.sensorData);
        this.zSum = sumByParameterArray(Z,this.sensorData);
        this.XY_x = this.xSum / (this.xSum + this.ySum + this.zSum);
        this.XY_y = this.ySum / (this.xSum + this.ySum + this.zSum);
        this.UV_u = 4*this.XY_x / (-2*this.XY_x + 12*this.XY_y + 3);
        this.UV_v = 9*this.XY_y / (-2*this.XY_x + 12*this.XY_y + 3);
        this.Duv = CountDuv(this.XY_x,this.XY_y);
        this.Pwave = CountPwave(this.sensorData);
        this.Dwave = CountDwave(this.sensorData);


    }

    private int CountDwave(double[] sensorData) {
        int res = 0;
        double max = 0;
        for(int i=0;i<sensorData.length;i++){
            if (max < sensorData[i]){
                max = sensorData[i];
                res = i;
            }
        }
        return res;
    }

    private int CountPwave(double[] sensorData) {
        int res = 0;
        double max =0;
        for (int i=0;i<sensorData.length;i++){
            if (sensorData[i]*illuminance[i] > max){
                max = sensorData[i]*illuminance[i];
                res = i;
            }
        }
        return res;
    }

    private double CountDuv(double xy_x, double xy_y) {
        double u = 4*xy_x / (-2*xy_x + 12*xy_y + 3);
        double v = 6*xy_y / (-2*xy_x + 12*xy_y + 3);
        double Lfp = Math.sqrt( (u - 0.292)*(u - 0.292) + (v - 0.24)*(v - 0.24) );
        double a = Math.acos( (u - 0.292)*(u - 0.292) / Lfp);
        double k6 = -0.00616793;
        double k5 =  0.0893944;
        double k4 = -0.05179722;
        double k3 =  1.5317403;
        double k2 = -2.4243787;
        double k1 =  1.925865;
        double k0 = -0.471106;
        double Lbb = k6* Math.pow(a,6) + k5*Math.pow(a,5) + k4*Math.pow(a,4) + k3*Math.pow(a,3) + k2*Math.pow(a,2) + k1*Math.pow(a,1) + k0;
        return Lfp - Lbb;
    }



    public double sumByParameterArray(double[] parameterArray, double[] sensorData) {
        //运算过程中的小数处理问题：由于处理数据众多，小数的政策可能很大的影响数据的结果
        double res = 0.0;
        int i = 0;
        while (i < sensorData.length) {
            res = res + sensorData[i] * parameterArray[i++];
        }
        return  res;
    }

